import ExpenseItem from "./components/ExpenseItem";
import './Expenses.css'

function Expenses(props){

    return(
        
        <ExpenseItem
            title={props.expenseList[0].title} 
            amount={props.expenseList[0].amount} 
            date={props.expenseList[0].date}>
        </ExpenseItem>
        
        
    );
}

export default Expenses;
